(77, 1357, 176, 'বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার', 'বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার', '<span style=\"color: rgb(114, 114, 114); font-family: arial, kalpurush, sans-serif; font-size: 17px; text-align: justify; background-color: rgb(248, 248, 248);\">বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার, মাধবপুর,হবিগঞ্জ। বিদ্যালয়টি মহান সুফি সাধক হযরত শাহজালাল ইয়ামনি (রহঃ) এর অন্যতম শিষ্য হযরত শাহ সুলায়মান ফতেহগাজী বোগদাদী (রহঃ) এর পবিত্র স্মৃতি বিজরিত রঘুনন্দন পাহাড়ের পাদদেশে শান্ত, স্নিগ্ধ ও শ্যামল মনোরম প্রাকৃতিক পরিবেশে শাহজিবাজারে অবস্থিত।</span>', '', NULL, '', '', '', '', 1480578056, 1),
