(1, 'বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার', 'মানসিক ও শারীরিক উৎকর্ষের  জন্য শিক্ষা', '০১/০১/১৯৬৮ খ্রিঃ', '১২৯৪৬৩', '', 'logo1.png', '', '০১৭৩০-৭১০৮১৪', 'pdbschoolsbazar@gmail.com', 'ডাকঘরঃ শাহজিবাজার-৩৩৩২ , উপজেলাঃ মাধবপুর , জেলাঃ হবিগঞ্জ।', 'http://bubhssb.edu.bd/', 'বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার', 'সকাল ৮ঃ০০ টা থেকে বিকাল ২ঃ০০ টা পর্যন্ত', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d58145.34237971652!2d91.38097199303503!3d24.378384626395977!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xeec983fb43aa05c1!2sHabiganj+Post+Office!5e0!3m2!1sen!2s!4v1477209699249\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', '     বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার, মাধবপুর,হবিগঞ্জ। বিদ্যালয়টি মহান সুফি সাধক হযরত শাহজালাল ইয়ামনি (রহঃ) এর অন্যতম শিষ্য হযরত শাহ সুলায়মান ফতেহগাজী বোগদাদী (রহঃ) এর পবিত্র স্মৃতি বিজরিত রঘুনন্দন পাহাড়ের পাদদেশে শান্ত, স্নিগ্ধ  ও শ্যামল মনোরম প্রাকৃতিক পরিবেশে শাহজিবাজারে অবস্থিত।', 'মোঃ আবুল হোসেন ', '01730710814', 'bubhssb.high.school@gmail.com', 'Capture1.PNG', 'Capture1.PNG', 'তথ্য ও যোগাযোগ প্রযুক্তির চরম উন্নতির ফলে সারা পৃথিবী আজ মানুষের হাতের মুঠোয়। গোটা পৃথিবী আজ একটি ‘বিশ্বগ্রাম।’ ভৌগোলিক বিচ্ছিন্নতা কিংবা দূরত্বের বিশালতা যোগাযোগের ক্ষেত্রে আজ আর কোনো বাধা নয়। দ্রূত পরিবর্তনশীল পৃথিবীর সঙ্গে খাপ খাইয়ে চলতে হলে ইন্টারনেট এবং সামাজিক যোগাযোগ মাধ্যমের কোনো বিকল্প নেই। বর্তমান সরকার ঘোষিত ভিশন ২০২১ অর্জনের উদ্দেশ্যে ডিজিটাল বাংলাদেশ গড়ার লক্ষ্যে সরকারের গৃহীত পদক্ষেপের সাথে তাল মিলিয়ে চলছে \r\n    বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার।এ ক্ষেত্রে বিদ্যালয়টি কোন অংশে পিছিয়ে নেই। এ লক্ষ্যকে সামনে রেখে বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার তার নিজস্ব ওয়েবসাইট তৈরি করে ওয়েবসাইটের মাধ্যমে বিদ্যালয়ের সকল তথ্য ছাত্র, শিক্ষক ও অভিভাবকের কাছে দ্রুত পৌঁছে দেয়ার ব্যবস্থা করেছে। ভর্তি কার্যক্রম থেকে শুরু করে ফলাফল প্রস্তুত করাসহ সকল কাজ অনলাইন সফটওয়ারের মাধ্যমে করার পদক্ষেপ হাতে নেয়া হয়েছে। আশা করছি ভবিষ্যতে ছাত্র ও শিক্ষকদের ডাটাবেজ তৈরি করে সকল তথ্য সংরক্ষণ করার ব্যবস্থা করা সম্ভব হবে। বিদ্যালয়ের আপডেট তথ্য সকলের কাছে পৌঁছে দেয়ার জন্য বিদ্যালয়ের ওয়েবসাইট বিশেষ ভুমিকা পালন করবে। আমাদের দৃঢ় বিশ্বাস এটি বিদ্যালয়ের শিক্ষক, শিক্ষার্থী, অভিভাবক, শিক্ষা বোর্ড, বিদ্যুৎ উন্নয়ন বোর্ড এবং প্রশাসন তথা সকল অংশীজনের মধ্যে নিবিড় যোগাযোগের জন্য সেতুবন্ধন হিসেবে গুরুত্বপূর্ণ ভূমিকা রাখবে এবং বিপুল তথ্য ভান্ডারের মহাসড়কের প্রবেশদ্বার হিসেবে কাজ করবে।', 'blankavatar.jpg', 'lightgreentheme', NULL, NULL, NULL);
