(3, 'নোটিশ বোর্ড', 'notice-board', NULL, 0, 0, '<h2>ভর্তি বিজ্ঞপ্তি</h2>\r\n<p>\r\nএতদ্বারা সংশ্লিষ্ট সকলকে জানানো যাচ্ছে যে, বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার-এ ১ম শ্রেণীতে ২০১৭ শিক্ষাবর্ষে ২৫ টি আসনে বহিরাগত ছাত্রÑছাত্রী ভর্তি করা হবে। আগামী ১৪/১২/২০১৬ইং তারিখ হতে ২১/১২/২০১৬ইং তারিখের মধ্যে বিদ্যালয়ের অফিস থেকে ভর্তি ফরম সংগ্রহ করা যাবে/ বিদ্যালয়ের ওয়েব সাইট িি.িনঁনযংংন.বফঁ.নফ থেকে ডাউনলোড করা যাবে। বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার, সঞ্চয়ী হিসাব নং-০৬৬৬-৮, জনতা ব্যাংক লিঃ, শায়েস্তাগঞ্জ শাখা. এর অনুকূলে ২০০/- (দুই শত) টাকার ব্যাংক ড্রাফট/ পে-অর্ডারসহ যথাযথভাবে পূরণকৃত ফরম প্রতি কার্যদিবসে সকাল ০৯:০০ ঘটিকা থেকে দুপুর ০১:০০ ঘটিকা পর্যন্ত বিদ্যালয়ের অফিস সহকারীর নিকট উল্লেখিত তারিখের মধ্যে জমা দিতে হবে। ২৯/১২/২০১৬ইং তারিখ সকাল ১০ঃ০০ ঘটিকায় প্রধান শিক্ষকের দপ্তর কক্ষে পরীক্ষার্থীদের প্রাক্-প্রাথমিক জ্ঞান এবং বিদ্যুৎ উন্নয়ন বোর্ডের চিকিৎসা কর্মকর্তার দ্বারা পরীক্ষার্থীদের বয়স যাচাই করা হবে। প্রাক্-প্রাথমিক জ্ঞানসম্পন্নœ শিক্ষার্থীদের মধ্য হতে লটারির মাধ্যমে ভর্তির জন্য শিক্ষার্থী বাছাই করা হবে ও বিদ্যালয়ের ওয়েবসাইটে চূড়ান্ত তালিকা প্রকাশ করা হবে এবং একই সাথে একটি অপেক্ষমান তালিকাও প্রকাশ করা হবে। আগামী ৩০/১২/২০১৬খ্রিঃ তারিখে লটারির মাধ্যমে নির্বাচিত শিক্ষার্থীদের ভর্তি প্রক্রিয়া সম্পন্ন করা হবে।</p>\r\n\r\n<p>\r\nএতদ্বারা সংশ্লিষ্ট সকলকে জানানো যাচ্ছে যে, বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার-এ ১ম শ্রেণীতে ২০১৭ শিক্ষাবর্ষে ২৫ টি আসনে বহিরাগত ছাত্রÑছাত্রী ভর্তি করা হবে। আগামী ১৪/১২/২০১৬ইং তারিখ হতে ২১/১২/২০১৬ইং তারিখের মধ্যে বিদ্যালয়ের অফিস থেকে ভর্তি ফরম সংগ্রহ করা যাবে/ বিদ্যালয়ের ওয়েব সাইট িি.িনঁনযংংন.বফঁ.নফ থেকে ডাউনলোড করা যাবে। বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয় শাহজিবাজার, সঞ্চয়ী হিসাব নং-০৬৬৬-৮, জনতা ব্যাংক লিঃ, শায়েস্তাগঞ্জ শাখা. এর অনুকূলে ২০০/- (দুই শত) টাকার ব্যাংক ড্রাফট/ পে-অর্ডারসহ যথাযথভাবে পূরণকৃত ফরম প্রতি কার্যদিবসে সকাল ০৯:০০ ঘটিকা থেকে দুপুর ০১:০০ ঘটিকা পর্যন্ত বিদ্যালয়ের অফিস সহকারীর নিকট উল্লেখিত তারিখের মধ্যে জমা দিতে হবে। ২৯/১২/২০১৬ইং তারিখ সকাল ১০ঃ০০ ঘটিকায় প্রধান শিক্ষকের দপ্তর কক্ষে পরীক্ষার্থীদের প্রাক্-প্রাথমিক জ্ঞান এবং বিদ্যুৎ উন্নয়ন বোর্ডের চিকিৎসা কর্মকর্তার দ্বারা পরীক্ষার্থীদের বয়স যাচাই করা হবে। প্রাক্-প্রাথমিক জ্ঞানসম্পন্নœ শিক্ষার্থীদের মধ্য হতে লটারির মাধ্যমে ভর্তির জন্য শিক্ষার্থী বাছাই করা হবে ও বিদ্যালয়ের ওয়েবসাইটে চূড়ান্ত তালিকা প্রকাশ করা হবে এবং একই সাথে একটি অপেক্ষমান তালিকাও প্রকাশ করা হবে। আগামী ৩০/১২/২০১৬খ্রিঃ তারিখে লটারির মাধ্যমে নির্বাচিত শিক্ষার্থীদের ভর্তি প্রক্রিয়া সম্পন্ন করা হবে।</p>\r\n\r\n<p>\r\n<strong>শর্তাবলিঃ</strong>\r\n</p><ul class=\"list-unstyled\">\r\n<li>১। আবেদনকারীর বয়স ০১/০১/২০১৭খ্রিঃ তারিখে অবশ্যই ৬ থেকে ৭ বছর বয়সের মধ্যে হতে হবে অর্থাৎ আবেদনকারীর জন্ম তারিখ\r\n    ০১/০১/২০১০খ্রিঃ হতে ০১/০১/২০১১খ্রিঃ এর মধ্যে হতে হবে।</li>\r\n<li>২। আবেদনকারীর প্রাক্-প্রাথমিক জ্ঞান থাকতে হবে।  </li>\r\n<li>৩। আসন সংখ্যার দ্বিগুণ সংখ্যক যোগ্য শিক্ষার্থীর মধ্য হতে লটারির মাধ্যমে নির্ধারিত সংখ্যক আসনে ছাত্র-ছাত্রী ভর্তির জন্য নির্বাচন করা হবে।  </li>\r\n<li>৪। ভর্তি ফরমের সাথে ০২ (দুই) কপি পাসপোর্ট সাইজের ছবি এবং জন্ম নিবন্ধন সনদের সত্যায়িত অনুলিপি জমা দিতে হবে।</li>\r\n<li>৫। ২৯/১২/২০১৬ইং তারিখে জন্ম নিবন্ধন সনদের মূলকপি প্রদর্শন করতে হবে।</li>\r\n<li>৬। অসম্পূর্ণ এবং মিথ্যা তথ্য সম্বলিত ফরম সরাসরি বাতিল বলে গণ্য হবে এবং কোন প্রকার প্রতারণার আশ্রয় নিলে ভর্তি বাতিলসহ\r\n     ভবিষ্যতে অত্র বিদ্যালয়ে ভর্তির ক্ষেত্রে সংশ্লিষ্ট শিক্ষার্থী অযোগ্য বলে গণ্য হবে।</li>\r\n<li>৭। ভর্তির ব্যাপারে যে কোনো প্রকার তদবির/ সুপারিশ শিক্ষার্থীদের অযোগ্যতা বলে গণ্য হবে।</li>\r\n<li>৮। কোনো ব্যক্তি/ ব্যক্তিবর্গ ভর্তি সংশ্লিষ্ট কোন কর্মকর্তা/ শিক্ষক-শিক্ষিকাকে কোনো প্রকার প্রভাবিত করার চেষ্টা করলে তার/ তাদের\r\n    বিরুদ্ধে আইনানুগ ব্যবস্থা গ্রহণ করা হবে।  </li>\r\n<li>৯। সরকারী বিধিমোতাবেক ভর্তির ক্ষেত্রে সকল প্রকার কোটা সংরক্ষণ করা হবে। কোটায় ভর্তির ক্ষেত্রে প্রমাণস্বরূপ কোটা প্রাপ্তির সংশ্লিষ্ট\r\n    সনদের সত্যায়িত অনুলিপি ভর্তিফরমের সঙ্গে জমা দিতে হবে।</li>\r\n<li>১০। নির্ধারিত সময়ে ভর্তি না হলে, শূন্য আসনে অপেক্ষমান তালিকা হতে লটারির ক্রমানুসারে শিক্ষার্থী ভতি করা হবে।</li>\r\n<li>১১। আসন সংখ্যা হ্রাস-বৃদ্ধির ক্ষেত্রে কর্তৃপক্ষের সিদ্ধান্তই চূড়ান্ত বলে গণ্য হবে। </li>\r\n</ul><div><br></div>\r\n\r\n<a href=\"http://bubhssb.edu.bd/uploads/posts/mssg.txt\" target=\"_blank\" class=\"btn btn-default\">Download Admission Form</a>', '2015-02-09', 0, 1, 1),
(4, 'প্রতিষ্ঠানের নিয়ম শৃঙ্খলা', 'rules', NULL, 1, 0, '<h2 class=\"text-center\"><b>নিয়মাবলী</b></h2>\r\n      <table class=\"table table-bordered table-striped\">\r\n        <tbody>\r\n            <tr>\r\n                <td>নিয়মাবলী: </td>\r\n                <td>ভর্তিঃ 	প্রতি বছর ডিসেম্বর মাসের শেষ সপ্তাহে প্রথম শ্রেণিতে শিক্ষার্র্থী ভর্তি করা হয়। অন্যান্য শ্রেণিতে আসন খালি থাকা সাপেক্ষে শিক্ষার্থী ভর্তি করা হয়। ভর্তির জন্য নির্ধারিত ফরমে আবেদন করতে হয়। ভর্তি পরীক্ষায়  মেধার ভিত্তিতে নির্বাচিত শিক্ষার্থীরা বিদ্যালয়ে ভর্তির সুযোগ পায়।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>শিক্ষাবর্ষঃ </td>\r\n                <td>পহেলা জানুয়ারি হতে একত্রিশে ডিসেম্বর।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>বিদ্যালয়ের সময়সূচীঃ</td>\r\n                <td>বাংলাদেশ বিদ্যুৎ উন্নয়ন বোর্ডের শ্রম ও কল্যাণ পরিদপ্তরের ২৩.০৮.৮৪ ইং তারিখের দপ্তরাদেশ নং-বিউবো (শ্রম) বিবিধ-৭০/৭৬/৬৫৬ অনুসারে বিদ্যালয়ের সময়সূচী সকাল ৮:০০ টা হতে বিকাল ২:০০ টা পর্যন্ত। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>অনুমোদিত বিভাগসমূহঃ</td>\r\n                <td>বিদ্যালয়ে নবম-দশম শ্রেণিতে বিজ্ঞান ও মানবিক বিভাগে সিলেট শিক্ষাবোর্ড কতর্ৃৃক পাঠদানের অনুমোদন রয়েছে। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>অধ্যয়নের বিষয়সমূহঃ</td>\r\n                <td>জাতীয় শিক্ষাক্রম ও পাঠ্যপুস্তক বোর্ড কর্তৃক নির্ধারিত ও অনুমোদিত পুস্তকসমূহ।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>বিভাগ নির্বাচনঃ</td>\r\n                <td>নবম শ্রেণিতে বিজ্ঞান বিভাগ নির্বাচনের ক্ষেত্রে জেএসসি পরীক্ষায় গণিত ও বিজ্ঞান বিষয়ের প্রতিটিতে ন্যুনতম “এ” গ্রেড পাওয়া প্রয়োজন। তাছাড়া নবম শ্রেণিতে উচ্চতর গণিত বিষয়টি নিতে হলে আবশ্যকীয়ভাবে জেএসসি পরীক্ষায় গণিত বিষয়ে “এ+” গ্রেড পেতে হবে।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>পরীক্ষাঃ</td>\r\n                <td>বিদ্যালয়ে সাপ্তাহিক ও মাসিক পরীক্ষা প্রচলিত আছে। তাছাড়া শিক্ষার্থীদের প্রস্তুতির স্বার্থে দুটি মডেল টেস্ট নেয়া হয়। অর্ধ-বার্ষিক/ প্রাক্ নির্বাচনী, বার্ষিক/ নির্বাচনী পরীক্ষার ফলাফল গ্রেডিং পদ্ধতিতে প্রকাশ করা হয় এবং বার্ষিক/ নির্বাচনী পরীক্ষার ফলাফলের ভিত্তিতে পরবর্তী শ্রেণিতে প্রমোশন/ পাবলিক পরীক্ষায় সেন্ট-আপ করা হয়। প্রতি পরীক্ষার প্রগতিপত্র অভিভাবকের নিকট পাঠানো হয়।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>ফলাফলঃ </td>\r\n                <td>কেবলমাত্র সকল বিষয়ে উত্তীর্ণ ছাত্র/ ছাত্রীদের পরবর্তী শ্রেণিতে প্রমোশন/ পাবলিক পরীক্ষায় সেন্ট-আপ করা হয়। অনুত্তীর্ণ শিক্ষার্থীর পরবর্তী শ্রেণিতে প্রমোশন বা পাবলিক পরীক্ষায় সেন্ট-আপ এর জন্য তদবির/ সুপারিশ কোনভাবেই কাম্য নয়। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>উত্তরপত্র নিরীক্ষণঃ</td>\r\n                <td>বার্ষিক পরীক্ষার উত্তরপত্র নিরীক্ষণ করতে হলে প্রতি পত্রের জন্য ১০০/- টাকা  হারে “প্রধান শিক্ষক, বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার” এর 	অনুকূলে সঞ্চয়ী হিসাব নং- ৬৬৬-৮, জনতা ব্যাংক লিঃ, শায়েস্তাগঞ্জ শাখা, হবিগঞ্জে	 ডিডি/ পে-অর্ডার করতঃ নির্ধারিত আবেদনপত্র পূরণ করে ফলাফল প্রকাশের সাত দিনের মধ্যে প্রধান শিক্ষক বরাবরে জমা দিতে হবে।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>প্রাত্যহিক সমাবেশঃ </td>\r\n                <td>প্রাত্যহিক সমাবেশে প্রার্থনা, শপথ, জাতীয় সংগীত এবং শরীরচর্চার ব্যবস্থা  থাকে। প্রাত্যহিক সমাবেশের অনুষ্ঠানমালায় সকলের অংশগ্রহণ বাধ্যতামূলক। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>জাতীয় দিবস উদযাপনঃ</td>\r\n                <td>যথাযথ মর্যাদা ও ভাব গাম্ভীর্যের মধ্য দিয়ে বিদ্যালয়ে জাতীয় দিবসসমূহ  উদযাপন করা হয়। জাতীয় দিবসের অনুষ্ঠানমালায় সকল শিক্ষার্থীর অংশগ্রহণ বাধ্যতামূলক।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>অনুপুস্থিতি/ ছুটিঃ</td>\r\n                <td>পারিবারিক বা ব্যক্তিগত কারণে কোন শিক্ষার্থীর ছুটির প্রয়োজন হলে শিক্ষার্থীর পিতা/ মাতার স্বাক্ষরযুক্ত প্রধান শিক্ষক বরাবরে আবেদনের মাধ্যমে অগ্রিম ছুটি নেয়া যেতে পারে। যৌক্তিক কারণে কোন শিক্ষার্থীর অনুপস্থিতির ছুটির আবেদন তার পিতা/ মাতার সুপারিশের প্রেক্ষিতে মঞ্জুর করা যেতে পারে। যৌক্তিক কারণ ব্যতিত কোন শিক্ষার্থী বিদ্যালয়ে অনুপস্থিত থাকলে কিংবা বিদ্যালয় থেকে পলায়ন করলে প্রতি দিনের জন্য ২০/- টাকা হারে জরিমানা আদায় করা হবে এবং এক মাসে সাতদিন অনুপস্থিত/ পলায়নের জন্য হাজিরা খাতা থেকে নাম কাটা পড়বে।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>সংক্রামক রোগঃ</td>\r\n                <td>কোন শিক্ষার্থী ছোঁয়াচে বা সংক্রামক রোগে আক্রান্ত হলে তা প্রধান শিক্ষককে অবহিত করতে হবে এবং প্রয়োজনবোধে সম্পূর্ণ আরোগ্য না হওয়া পর্যন্ত বিদ্যালয়ে আসা থেকে বিরত থাকতে হবে।</td>\r\n            </tr>\r\n            <tr>\r\n                <td>ছাড়পত্রঃ </td>\r\n                <td>সাধারণতঃ ১ম থেকে ৮ম শ্রেণির কোন শিক্ষার্থীর বিদ্যালয়ের সমস্ত পাওনা পরিশোধ সাপেক্ষে পিতা/ মাতার স্বাক্ষর সম্বলিত আবেদনের প্রেক্ষিতে ছাড়পত্র প্রদান করা হয়। ৯ম-১০ম শ্রেণির শিক্ষার্থীদের ক্ষেত্রে সংম্লিষ্ট শিক্ষাবোর্ডের অনুমোদন সাপেক্ষে ছাড়পত্র ইস্যু করা হয়। শিক্ষার্র্থীর সাথে অভিভাবকের সাক্ষাৎকারঃ বিদ্যালয়চলাকালীন সময়ে প্রধান শিক্ষক/ সহকারী প্রধান শিক্ষকের অনুমতি ব্যতিত কোন অভিভাবক তাঁর সন্তান/ পোষ্যের সঙ্গে  সাক্ষাৎ করতে পারবেন না। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>নিরাপত্তা বিধিঃ</td>\r\n                <td>বিদ্যালয়টি কেপিআই এলাকায় অবস্থিত বিধায় বিদ্যালয়ের শিক্ষার্থী এবং অভিভাবককে বিদ্যুৎ কেন্দ্রের নিরাপত্তা বিধি মেনে চলতে হবে। </td>\r\n            </tr>\r\n            <tr>\r\n                <td>শাস্তিঃ</td>\r\n                <td>(ক) কোন শিক্ষার্থী বিদ্যালয়ের সম্পদ/ আসবাবপত্র বিনষ্ট করলে তাকে উপযুক্ত \r\n		     ক্ষতিপূরণ দিতে হবে। <br>\r\n		    (খ) কোন শিক্ষার্থী যদি বিদ্যালয়ের নিয়ম-শৃঙ্খলা পরিপন্থী কোন কাজে লিপ্ত হয় \r\n		     বা পরোক্ষভাবে অন্যকে প্রলুব্ধ করে তাহলে তাকে বাধ্যতামূলক ছাড়পত্র দেয়া \r\n		     হবে। <br>\r\n      		(গ) কোন শিক্ষার্থী যদি মোবাইল ফোন/ গান বা ছবি সম্বলিত কোন ইলেক্ট্রনিক \r\n		     ডিভাইস বিদ্যালয়ে আনে তবে তার মোবাইল ফোন/গান বা ছবি সম্বলিত কোন \r\n		     ইলেক্ট্রনিক ডিভাইস বাজেয়াপ্ত করা হবে এবং তাকে বাধ্যতামূলক ছাড়পত্র দেয়া \r\n		     হবে। <br>\r\n		    (ঘ) কোন শিক্ষার্থী পরপর দুই বছর একই শ্রেণিতে অকৃতকার্য হলে তাকে \r\n		      বাধ্যতামূলক  ছাড়পত্র দেয়া হবে। <br> \r\n		    (ঙ) কোন শিক্ষার্থী যদি বিদ্যালয়ের অভ্যন্তরীণ পরীক্ষায় কোন প্রকার অসদুপায় \r\n		      অবলম্বন করে তবে তার ঐ টার্মের পরীক্ষাসমূহ  বাতিল করা হবে।</td>\r\n            </tr>\r\n        </tbody>\r\n      </table>', '2015-06-09', 0, 1, 1),
(5, 'মাস্টারপ্ল্যান', 'masterplan', NULL, 2, 0, 'আমাদের ভিশন/ লক্ষ্য হল বিদ্যালয়টিকে প্রাথমিক ও মাধ্যমিক পর্যায়ের শিক্ষার্থীদের জন্য একটি উৎকর্ষ বিদ্যাপীঠে<br>পরিণত করা।<br><br>&nbsp;আমাদের মিশন/ উদ্দেশ্য হল শিক্ষার্থীদেরকে নৈতিকতায়, সামাজিকতায় এবং দক্ষতায় সমৃদ্ধ করে আলোকিত মানব<br>সম্পদে রুপান্তিরিত করা। কোমলমতি শিক্ষার্থীদেরকে গুণগত শিক্ষা প্রদান এবং তাদের সুপ্ত প্রতিভা বিকাশ ও অফুরন্ত<br>সম্ভাবনাসমূহকে কাজে লাগিয়ে নতুন শতাব্দীর চ্যালেঞ্জ মোকাবিলায় তাদেরকে উপযুক্ত করে গড়ে তুলতে আমাদের শিক্ষকগণ<br>নিবেদিত । <br>', '2015-28-07', 0, 1, 1),
(6, 'একাডেমিক  ক্যালেন্ডার', 'academiccalendar', NULL, 88, 0, '<p><center>২০১৬ শিক্ষাবর্ষের একাডেমিক ক্যালেন্ডার</center></p>\r\n<table class=\"dataTable table table-bordered table-striped\">\r\n <tbody>\r\n  <tr>\r\n   <td>পরীক্ষার নাম</td>\r\n   <td>তারিখ ও দিন </td>\r\n   <td>দিন সংখ্যা</td>\r\n   <td>ফলাফল প্রকাশ</td>\r\n  </tr>\r\n  <tr>\r\n   <td>বার্ষিক পরীক্ষা ও প্রাক-নির্বাচনী</td>\r\n   <td>১১ জুলাই, সোমবার থেকে ২৫ জুলাই, সোমবার পর্যন্ত</td>\r\n   <td>১৩ দিন</td>\r\n   <td>০৬ আগষ্ট শনিবার</td>\r\n  </tr>\r\n  <tr>\r\n   <td>নির্বাচনী পরীক্ষা</td>\r\n   <td>১৬ অক্টোবর, রবিবার থেকে ৩১ অক্টোবর, সোমবার পর্যন্ত</td>\r\n   <td>১৩ দিন</td>\r\n   <td>০৫ নভেম্বর শনিবার</td>\r\n  </tr>\r\n  <tr>\r\n   <td>বার্ষিক পরীক্ষা</td>\r\n   <td>২৮ নভেম্বর, সোমবার থেকে ১৪ ডিসেম্বর, বুধবার পর্যন্ত </td>\r\n   <td>১৩ দিন</td>\r\n   <td>২৯ ডিসেম্বর বৃহস্পতিবার </td>\r\n  </tr>\r\n  \r\n \r\n  \r\n </tbody>\r\n</table>\r\n', '2015-28-07', 0, 1, 1),
(7, 'কর্মরত জনবল', 'workingmanpower', NULL, 57, 7, '<table class=\"table table-striped table-bordered dataTable\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" height=\"460\" width=\"861\">\r\n <tbody>\r\n  <tr>\r\n   <td>পদবী</td>\r\n   <td>কর্মরত মোট</td>\r\n   <td>কর্মরত মহিলা</td>\r\n   <td>কর্মরত পুরুষ</td>\r\n   <td>MPO ভূক্ত মোট</td>\r\n   <td>MPO ভূক্ত মহিলা</td>\r\n   <td>MPO ভূক্ত পুরুষ</td>\r\n  </tr>\r\n  <tr>\r\n   <td>প্রধান শিক্ষক</td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n   <td>০১<br></td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n   <td>০১<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>সহকারি প্রধান শিক্ষক</td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n   <td>০১<br></td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n   <td>০১<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>সহকারী শিক্ষক</td>\r\n   <td>১০<br></td>\r\n   <td>০৩<br></td>\r\n   <td>০৭<br></td>\r\n   <td>০৮<br></td>\r\n   <td>০১<br></td>\r\n   <td>০৭<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>জুনিয়র শিক্ষক</td>\r\n   <td>০০<br></td>\r\n   <td>০০<br></td>\r\n   <td>০০<br></td>\r\n   <td>০০<br></td>\r\n   <td>০০<br></td>\r\n   <td>০০<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>কম্পিউটার শিক্ষক</td>\r\n   <td>০১<br></td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n   <td>০১<br></td>\r\n   <td>০১<br></td>\r\n   <td>০০<br></td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n', '2015-28-07', 0, 0, 1),
(8, 'খেলার মাঠ', 'playground', NULL, 58, 0, 'বিদ্যালয়ের সংলগ্ন একটি খেলার মাঠ আছে। এখানে নিয়মিত খেলাধুলার চর্চা হয়। তাছাড়া ফুটবল, ভলিবল, ক্রিকেটসহ বিভিন্ন ধরনের প্রতিযোগিতামূলক খেলা অনুষ্ঠিত হয়। প্রতি বছর খেলার মাঠে বিদ্যালয়ের বার্ষিক ক্রীড়া প্রতিযোগিতা অনুষ্ঠিত হয়। \r\n ', '2015-30-07', 0, 1, 1),
