(12, 'প্রতিষ্ঠানের ইতিহাস', 'history', NULL, 1, 0, '<div style=\"font-weight: normal; font-style: normal; text-align: center;\"><span style=\"font-size: x-large; font-weight: bold; color: rgb(204, 0, 0);\">বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার,\r\n</span><span style=\"font-weight: bold; color: rgb(204, 0, 0); font-size: x-large;\">মাধবপুর,হবিগঞ্জ।&nbsp;</span></div><div style=\"font-weight: normal; font-style: normal; text-align: center;\"><span style=\"font-weight: bold; color: rgb(204, 0, 0); font-size: x-large;\"><br></span></div><div style=\"font-weight: normal; font-style: normal; text-align: center;\"><span style=\"font-weight: bold; color: rgb(204, 0, 0); font-size: x-large;\"><br></span></div><span style=\"font-weight: bold; color: rgb(0, 102, 0); font-size: xx-large;\"><div style=\"text-align: center;\">&lt;&lt;&lt;&lt;&lt;ভূমিকা&gt;&gt;&gt;&gt;&gt;</div></span><div style=\"font-size: 10pt;\"><span style=\"color: rgb(0, 0, 153);\"><span style=\"font-weight: bold;\"><br><span style=\"font-size: x-large;\">তৎকালীন পূর্ব পাকিস্তান ওয়াপদা কর্তৃপক্ষ বৃহত্তর সিলেটের শাহজিবাজার-এ ১৯৬৬ সালে শাহজিবাজার বিদ্যুৎ উৎপাদন কেন্দ্র প্রতিষ্ঠা করেন। শাহজিবাজার বিদ্যুৎ উৎপাদন কেন্দ্র প্রতিষ্ঠার প্রাক্কালে বিদ্যুৎ কেন্দ্রে কর্মরত কর্মকর্তা ও কর্মচারীদের সন্তান ও পোষ্যদের শিক্ষার জন্য একটি বিদ্যালয় প্রতিষ্ঠার প্রয়োজনীয়তা তীব্রভাবে অনুভূত হয়। তাই শাহজিবাজার বিদ্যুৎ কেন্দ্র কর্তৃপক্ষ ১৯৬৮ সালে বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার প্রতিষ্ঠা করেন। বিদ্যালয়টি মহান সুফি সাধক হযরত শাহজালাল ইয়ামনি (রহঃ) এর অন্যতম শিষ্য হযরত শাহ সুলায়মান ফতেহগাজী বোগদাদী (রহঃ) এর পবিত্র স্মৃতি বিজরিত রঘুনন্দন পাহাড়ের পাদদেশে শান্ত, স্নিগ্ধ ও শ্যামল মনোরম প্রাকৃতিক পরিবেশে শাহজিবাজারে অবস্থিত। ইহা ১৯৭৪ সালে মাধ্যমিক ও উচ্চ মাধ্যমিক শিক্ষা বোর্ড, কুমিল্লা’র একাডেমিক স্বীকৃতি লাভ করে। ১৯৭৬ সালে বিদ্যালয় হতে প্রথম বারের মত এসএসসি পরীক্ষায় শিক্ষার্থী অংশগ্রহণ করে শতভাগ পাশের গৌরব অর্জন করে। বর্তমানে বিদ্যালয়টি বাংলাদেশ বিদ্যুৎ উন্নয়ন বোর্ডের ব্যবস্থাপনায় পরিচালিত হচ্ছে। সামাজিক দায়বদ্ধতা থেকে বিদ্যুৎ উন্নয়ন বোর্ড বিদ্যালয়টি পরিচালনা করে। <br><br>পার্শ্ববর্তী এলাকার শিক্ষার্থীরাও এখানে ভর্তির সুযোগ পায়। প্রতিষ্ঠার শুরু থেকেই বিদ্যালয়টি পাবলিক পরীক্ষাসমূহে অসাধারণ কৃতিত্ব অর্জন এবং সহপাঠক্রমিক কার্যাবলিতে ঈর্ষনীয় সাফল্যের ধারা অব্যাহত রেখে চলেছে। বর্তমানে বিদ্যালয়টি গণপ্রজাতন্ত্রী বাংলাদেশ সরকার কর্তৃক অনুমোদিত এবং মাধ্যমিক ও উচ্চ মাধ্যমিক শিক্ষা বোর্ড, সিলেট কর্তৃক স্বীকৃতিপ্রাপ্ত। \r\n\r\n</span></span></span></div>', '2015-02-09', 0, 1, 1),
