(14, 'পরিষ্কার-পরিচ্ছন্নতা', 'cleanliness', NULL, 58, 0, 'বিদ্যালয়ের শিক্ষার্থীরা পরিষ্কার-পরিচ্ছন্নতা সচেতন। শিক্ষার্থীদের উদ্যোগে প্রতিটি শ্রেণিকক্ষ পরিষ্কার-পরিচ্ছন্ন রাখা হয়। শ্রেণিকক্ষগুলো পরিপাটি থাকে। তাছাড়া একজন পরিচ্ছন্নতা কর্মী সার্বক্ষণিক বিদ্যালয় প্রাঙ্গন পরিচ্ছন্নতার কাজে নিয়োজিত আছেন। বিদ্যালয়ে পরিষ্কার-পরিচ্ছন্নতা সপ্তাহ পালন করা হয়। &nbsp; &nbsp;  ', '2015-10-08', 0, 1, 1),
(15, 'শরীরচর্চা', 'athletics', NULL, 58, 0, 'একজন শিক্ষক শরীরচর্চা ক্লাস পরিচালনার জন্য নিয়োজিত আছেন। প্রতিদিন সকাল ৮ঃ০০ ঘটিকায় সমাবেশ ক্লাস অনুষ্ঠিত হয় এবং শারীরিক কসরত ও ব্যায়াম চর্চা করা হয়। ৬ষ্ঠ শ্রেণি হতে ১০ম শ্রেণি পর্যন্ত নিয়মিত শরীরচর্চা ক্লাস হয়ে থাকে।   ', '2015-01-09', 0, 1, 1);
