(18, 'বিভিন্ন পরীক্ষার পরিসংখ্যান', 'exam-statistics', NULL, 22, 0, '<table class=\"dataTable table table-bordered table-striped\">\r\n <tbody>\r\n  <tr>\r\n   <td>সন</td>\r\n   <td>মোট পরীক্ষার্থী</td>\r\n   <td>মোট উত্তীর্ণ</td>\r\n   <td>পাশের হার</td>\r\n   <td>A+</td>\r\n   <td>A</td>\r\n   <td>A-</td>\r\n  </tr>\r\n  <tr>\r\n   <td>২০১৫</td>\r\n   <td>২১৫</td>\r\n   <td>২১৫</td>\r\n   <td>৯৩%</td>\r\n   <td>১৫</td>\r\n   <td>২৫</td>\r\n   <td>২৫</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n', '2015-09-08', 0, 1, 1),
(19, 'বিদ্যালয়ের ভিশন ও মিশন', 'our-goal', NULL, 1, 2, '<span style=\"color: rgb(51, 102, 255);\"><span style=\"font-size: x-large;\">বিদ্যালয়ের ভিশন</span><span style=\"font-size: 10pt;\">:</span></span> <span style=\"font-size: large; color: rgb(255, 0, 0);\">আমাদের ভিশন/ লক্ষ্য হল বিদ্যালয়টিকে প্রাথমিক ও মাধ্যমিক পর্যায়েরশিক্ষার্থীদের জন্য একটি উৎকর্ষ বিদ্যাপীঠে\r\nপরিণত করা।&nbsp;</span><div style=\"text-align: left;\"><span style=\"color: rgb(204, 51, 204); font-size: x-large;\">বিদ্যালয়ের &nbsp;মিশন</span><span style=\"font-size: 10pt;\">: </span><span style=\"color: rgb(0, 51, 0); font-size: large;\">আমাদের মিশন/ উদ্দেশ্য হল শিক্ষার্থীদেরকে নৈতিকতায়, সামাজিকতায় এবং দক্ষতায় সমৃদ্ধ করে আলোকিত মানব\r\nসম্পদে রুপান্তিরিত করা। কোমলমতি শিক্ষার্থীদেরকে গুণগত শিক্ষা প্রদান এবং তাদের সুপ্ত প্রতিভা বিকাশ ও অফুরন্ত\r\nসম্ভাবনাসমূহকে কাজে লাগিয়ে নতুন শতাব্দীর চ্যালেঞ্জ মোকাবিলায় তাদেরকে উপযুক্ত করে গড়ে তুলতে আমাদের শিক্ষকগণ\r\nনিবেদিত । </span></div>', '2015-10-08', 0, 1, 1),
