(65, 'ইউনিফরম ও বেতন কাঠামো', 'Uniformsstructure', NULL, 57, 0, '<font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: bold; color: rgb(153, 0, 0);\">স্কুল ইউনিফরমঃ</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>বাংলাদেশ বিদ্যুৎ উন্নয়ন বোর্ডের শ্রম ও কল্যাণ পরিদপ্তরের ২৮.১১.২০১১ ইং তারিখের দপ্তরাদেশ <span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>নং-১৮৩-শ্রম-২/বিদ্যালয়/বিবিধ-৫৭/২০১১ অনুসারে বিদ্যালয়ের ইউনিফরম পরিধান করা সকল শিক্ষার্থীর <span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>জন্য বাধ্যতামূলক এবং বিদ্যুৎ উন্নয়ন বোর্ড কর্তৃক নির্ধারিত ইউনিফরম নিম্নরূপ:&nbsp;</span></font><div><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: bold; color: rgb(153, 0, 0);\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: bold; color: rgb(153, 0, 0);\">গ্রীষ্মকালীন ইউনিফরমঃ </span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"color: rgb(51, 51, 255);\"><span style=\"font-weight: bold;\">ছাত্রদের জন্যঃ</span>-</span><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"color: rgb(153, 102, 51);\">	</span>	</span>১ম-১০ম শ্রেণি- সাদা হাফ শার্ট (৩৫/ ৬৫ কাপড়ের), </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>ডীপ নেভীব্লু ফুল প্যান্ট ও কালো বেল্ট।&nbsp; &nbsp;</span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"color: rgb(0, 153, 0);\"><span style=\"font-weight: bold;\">ছাত্রীদের জন্যঃ</span>- </span><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>১ম-৩য় শ্রেণি- রয়েল ব্লু ফ্রক, সাদা বেল্ট।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>৪র্থ-১০ম শ্রেণি- রয়েল ব্লু কামিজ। বেল্ট, ওড়না ও </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>সালোয়ার সাদা রঙের।</span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"font-weight: bold; color: rgb(153, 0, 0);\">শীতকালীন ইউনিফরমঃ</span>&nbsp;&nbsp; </span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"font-weight: bold; color: rgb(51, 51, 255);\">ছাত্রদের জন্যঃ-<span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span></span>১ম-১০ম শ্রেণি- সাদা ফুল শার্ট, ডীপ নেভীব্লু ফুল প্যান্ট, </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>কালো বেল্ট এবং ডীপ নেভী ব্লু ভি-গলা ফুল/হাফ হাতা&nbsp; সোয়েটার। </span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(51, 204, 0);\">ছাত্রীদের জন্যঃ-<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span></span></span>১ম-৩য় শ্রেণি- রয়েল ব্লু ফ্রক, সাদা বেল্ট।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>৪র্থ-১০ম শ্রেণি-রয়েল ব্লু কামিজ। বেল্ট, ওড়না ও </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>সালোয়ার সাদা রঙের।</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>১ম-১০ম শ্রেণি- ডীপ নেভীব্লু ভি-গলা ফুল হাতা কার্ডিগান।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>কোন ছাত্রী বোরখা পরিধান করতে ইচ্ছুক হলে তাকে &nbsp;</span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>রয়েল ব্লু রঙের বোরখা পরিধান করতে হবে। </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">- ২ -</span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"font-weight: bold; color: rgb(153, 0, 0);\">জুতা ও মোজাঃ<span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span></span></span></font><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">সকল ছাত্র-ছাত্রীকে সাদা কেডস ও সাদা মোজা পড়তে হবে।</span></font><br><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\"><span style=\"font-weight: bold; color: rgb(153, 0, 0);\">স্কূল ব্যাজঃ<span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span></span></span></font><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\">বিদ্যালয় হতে বিদ্যালয়ের মনোগ্রাম খচিত ব্যাজ সরবরাহ করা হয়। ছাত্রদের বুক </span></font><br><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>পকেটে এবং ছাত্রীদের কামিজের/ ফ্রকের ডান হাতায় সেলাই করে ব্যাজ লাগাতে হবে। </span></font><br><br><span style=\"font-weight: bold; color: rgb(153, 0, 0);\"><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\">বেতন পরিশোধঃ<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span></span></font></span><span style=\"font-size: 10pt; color: rgb(51, 51, 51);\">বিদ্যালয়ের বেতন ও অন্যান্য ফি বাৎসরিক দুই কিস্তিতে আদায় করা হয়।</span><span style=\"font-size: 10pt; color: rgb(153, 0, 0);\">&nbsp;</span><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><div style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>নির্ধারিত তারিখে বেতনাদি পরিশোধে ব্যর্থ হলে হাজিরা খাতা থেকে নাম কেটে</span></div></font><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><div style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>দেয়া হয় এবং যথাযথ ফি প্রদানপূর্বক পুনঃ ভর্তি হতে হয়।</span></div></font><font face=\"Arial, Verdana\"><div style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"font-weight: normal; white-space: pre;\">		</span><span style=\"font-weight: bold;\">১ম কিস্তিঃ</span> জানুয়ারি -&nbsp;</span></div></font><font face=\"Arial, Verdana\" style=\"font-weight: normal;\"><div style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>জুন মাসের বেতন ও অন্যান্য ফি ১-১৫ জানুয়ারির মধ্যে পরিশোধ করতে হয়।&nbsp;</span></div></font><font face=\"Arial, Verdana\"><div style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><span class=\"Apple-tab-span\" style=\"font-weight: normal; white-space: pre;\">		</span><span style=\"font-weight: bold;\">২য় কিস্তিঃ</span> জুলাই&nbsp; -&nbsp;</span><span style=\"font-weight: normal; font-size: 10pt;\">ডিসেম্বর মাসের বেতন ও অন্যান্য ফি ১-১৫ জুলাইয়ের মধ্যে পরিশোধ করতে হয়।</span></div></font><div style=\"font-weight: normal;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>উত্তরপত্র নিরীক্ষণঃ বার্ষিক পরীক্ষার উত্তরপত্র নিরীক্ষণ করতে হলে প্রতি পত্রের জন্য ১০০/- টাকা &nbsp;</span></font></div><div style=\"font-weight: normal;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>হারে “প্রধান শিক্ষক, বিদ্যুৎ উন্নয়ন বোর্ড উচ্চ বিদ্যালয়, শাহজিবাজার” এর <span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>অনুকূলে সঞ্চয়ী হিসাব নং- <span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>৬৬৬-৮, জনতা ব্যাংক লিঃ, শায়েস্তাগঞ্জ শাখা, হবিগঞ্জে<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span> ডিডি/ পে-অর্ডার করতঃ নির্ধারিত আবেদনপত্র <span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span>পূরণ করে ফলাফল প্রকাশের সাত<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span> দিনের মধ্যে প্রধান শিক্ষক বরাবরে জমা দিতে হবে। &nbsp;&nbsp;</span><