i-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;mso-bidi-language:BN\" lang=\"BN\">&nbsp;<span style=\"mso-tab-count:1\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; </span>এই মর্মে\r\nপ্রত্যয়ন করা যাইতেছে যে,.............................................পিতা..................................... <br></span></p><p class=\"MsoNormal\" style=\"margin-left:0in;text-align:left;\r\ntab-stops:118.35pt center 261.65pt\" align=\"left\"><span style=\"font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;mso-bidi-language:BN\" lang=\"BN\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; মাতা................................. গ্রাম..............................ডাকঘর..........................................উপজেলা........................ জেলা...........................অত্র\r\nবিদ্যালয় ..............................তারিখে পরিত্যাগ করিল। সে ........... শ্রেনীতে\r\nপড়িতেছিল এবং বিদ্যালয়ের যাবতীয় পাওনা ........................পর্যন্ত পরিশোধ\r\nকরিয়াছে।ভর্তি বহি অনুসারে তাহার জন্ম তারিখ........................। রেজিঃ\r\nনং-.....................সন..................।</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:0in;text-align:left;\r\ntab-stops:118.35pt center 261.65pt\" align=\"left\"><span style=\"font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;mso-bidi-language:BN\" lang=\"BN\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>যতদুর আমি জানি , তাহার স্বভাব-চরিত্র\r\nভাল। আমি তাহার মঙ্গল কামনা করি।</span><span style=\"font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;mso-bidi-language:BN\" lang=\"BN\"><br></span></p><p class=\"MsoNormal\" style=\"margin-left:0in;text-align:left;\r\ntab-stops:118.35pt center 261.65pt\" align=\"left\"><span style=\"font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;mso-bidi-language:BN\" lang=\"BN\">&nbsp;&nbsp; ১। বিদ্যালয় পরিত্যাগের\r\nকারনঃ</span>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-left:0in;text-align:left;\r\ntab-stops:118.35pt center 261.65pt\" align=\"left\"><span style=\"font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-f