(83, 'বিভিন্ন পাবলিক পরীক্ষার ফলাফল', 'Results of public examination', NULL, 22, 0, '<font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">পরীক্ষাঃ<span class=\"Apple-tab-span\" style=\"white-space: pre;\">	<br></span>বিদ্যালয়ে সাপ্তাহিক ও মাসিক পরীক্ষা প্রচলিত আছে। তাছাড়া শিক্ষার্থীদের প্রস্তুতির স্বার্থে দুটি মডেল টেস্ট নেয়া হয়। অর্ধ-বার্ষিক/ প্রাক্ নির্বাচনী, বার্ষিক/ নির্বাচনী পরীক্ষার ফলাফল গ্রেডিং পদ্ধতিতে প্রকাশ করা হয় এবং বার্ষিক/ নির্বাচনী পরীক্ষার ফলাফলের ভিত্তিতে পরবর্তী শ্রেণিতে প্রমোশন/ পাবলিক পরীক্ষায় সেন্ট-আপ করা হয়। প্রতি পরীক্ষার প্রগতিপত্র অভিভাবকের নিকট পাঠানো হয়।</span></font><div><div></div></div>', '1450942749', 0, 1, 1),
(84, 'মাল্টিমিডিয়া ক্লাসরুম', 'multimedia-classroom', NULL, 58, 0, 'বিভিন্ন শ্রেণিকক্ষে মাল্টিমিডিয়ার সাহায্যে পাঠদান করা হয়। দক্ষ ও প্রশিক্ষিত শিক্ষকগণ পাওয়ার পয়েন্টের মাধ্যমে মাল্টিমিডিয়া ক্লাস পরিচালনা করেন। ', '1450942510', 0, 1, 1),
