(91, 'পিইসি ফলাফল', 'pscrsult', NULL, 22, 0, '<p>প্রাথমিক বৃত্তি পরীক্ষায় কৃতিত্বের পরিক্রমা </p>\r\n<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n<td>সন</td>\r\n<td>ট্যালেন্টপুল বৃত্তিপ্রাপ্তির সংখ্যা</td>\r\n<td>সাধারণ বৃত্তিপ্রাপ্তির সংখ্যা</td>\r\n<td>মোট প্রাপ্ত বৃত্তির সংখ্যা</td>\r\n<td>মন্তব্য</td>\r\n</tr>\r\n<tr>\r\n<td>২০০৫</td>					\r\n<td>০৬</td>\r\n<td>০৪</td>\r\n<td>১০</td>\r\n<td>-</td>\r\n</tr>\r\n		\r\n<tr>\r\n<td>২০০৬</td>					\r\n<td>১০</td>\r\n<td>০৫</td>\r\n<td>১৫</td>	\r\n<td>-</td>\r\n</tr>\r\n<tr>\r\n<td>২০০৭</td>					\r\n<td>০৭</td>\r\n<td>০৪</td>\r\n<td>১১</td>\r\n<td>-</td>	\r\n</tr>\r\n<tr>\r\n<tr>\r\n<td>২০০৮</td>					\r\n<td>০৩</td>\r\n<td>০৪</td>\r\n<td>০৭</td>\r\n<td>-</td>		\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>পপ্রাথমিক শিক্ষা সমাপনী  পরীক্ষায় কৃতিত্বের পরিক্রমা</p>\r\n<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n<td>সন</td>\r\n<td>মোট পরীক্ষার্থী</td>\r\n<td>মোট উত্তীর্ণ</td>\r\n<td>পাশের হার (%)</td>\r\n<td>১ম বিভাগ</td>\r\n<td>২য় বিভাগ</td>\r\n<td>৩য় বিভাগ</td>\r\n<td>প্রাপ্ত বৃত্তি</td>\r\n</tr>\r\n<tr>\r\n<td>২০০৯</td>					\r\n<td>৬০</td>\r\n<td>৬০</td>\r\n<td>১০০%</td>\r\n<td>৩৩</td>\r\n<td>১৭</td>\r\n<td>১০</td>\r\n<td>ট্যালেন্ট ৫</td>\r\n<td>সাধাঃ ০৩</td>\r\n<td>মোট - ০৮</td>\r\n</tr>\r\n		\r\n<tr>\r\n<td>২০১০</td>					\r\n<td>৫১</td>\r\n<td>৫১</td>\r\n<td>১০০%</td>\r\n<td>৪৮</td>	\r\n<td>০৩</td>\r\n<td>০০</td>\r\n<td>ট্যালেন্ট ৬</td>\r\n<td>সাধাঃ ০৫</td>\r\n<td>মোট - ১১</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>প্রাথমিক শিক্ষা সমাপনী  পরীক্ষায় কৃতিত্বের পরিক্রমা (গ্রেডিং পদ্ধতিতে)ঃ</p>\r\n<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n<td>সন</td>\r\n<td>মোট পরীক্ষার্থী</td>\r\n<td>মোট উত্তীর্ণ</td>\r\n<td>পাশের হার (%)</td>\r\n<td>A+</td>\r\n<td>A</td>\r\n<td>A-</td>\r\n<td>B</td>\r\n<td>C</td>\r\n<td>D</td>\r\n<td>F</td>\r\n<td>প্রাপ্ত বৃত্তি</td>\r\n</tr>\r\n<tr>\r\n<td>২০১১</td>					\r\n<td>৬২</td>\r\n<td>৬২</td>\r\n<td>১০০%</td>\r\n<td>১২</td>\r\n<td>২৩</td>\